import { useParams } from "react-router-dom";
import { Fragment } from "react";
import Comments from "./components/Comments";

const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quotes {params.quoteId}</h1>
      
    </Fragment>
  );
};
export default QuoteDetail;
